export const colorScheme = {
  darkBlue: "#4464AD",
  orange : "#F58F29",
  grayBlue : "#454B66",
  lightBlue : "#88B189",
  offWhite : "#DAE0F2"
}


export const buttonStyle = {backgroundColor:colorScheme.offWhite, border: "2px solid "+colorScheme.orange}
